import React from 'react';
import { View, Text, StyleSheet, Image, TouchableOpacity } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome'; // AsegÃºrate de instalar esta biblioteca

const Navbar = () => {
  return (
    <View style={[styles.navbar, styles.navbarWithMargin]}>
      <TouchableOpacity style={styles.menuIcon}>
        <Icon name="bars" size={30} color="white" />
      </TouchableOpacity>
      <Image
        source={require('../assets/img/GIcon.png')}
        style={styles.logo}
        resizeMode="contain"
      />
      <Text style={styles.navbarText}>Tuiranfit</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  navbar: {
    backgroundColor: 'black',
    flexDirection: 'row',
    padding: 10,
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: 10,
  },
  navbarWithMargin: {
    marginBottom: 10,
  },
  menuIcon: {
    marginRight: 10,
  },
  logo: {
    width: 30,
    height: 30,
    marginRight: 10,
  },
  navbarText: {
    color: 'white',
    fontSize: 20,
    fontWeight: 'bold',
  },
});

export default Navbar;
